"use strict";
(() => {
  // src/config.ts
  var base = [
    ["tool-secondary", "#242526"],
    ["tool-base", "#18191a"],
    ["tool-hover", "#3a3b3c"],
    ["tool-btn-bg", "#464E5F"],
    ["tool-text", "#B5B5C3"]
  ];
  var other = [
    ["yq-yuque-grey-9", "#FAFAFA"],
    ["yq-yuque-grey-8", "#F4F5F5"],
    ["yq-yuque-grey-7", "#EFF0F0"],
    ["yq-yuque-grey-6", "#E7E9E8"],
    ["yq-yuque-grey-5", "#D8DAD9"],
    ["yq-yuque-grey-4", "#BEC0BF"],
    ["yq-yuque-grey-3", "#8A8F8D"],
    ["yq-yuque-grey-2", "#585A5A"],
    ["yq-yuque-grey-1", "#262626"]
  ];

  // src/utils/tool.ts
  var upStoreConfig = (key, value) => {
    const currentKey = `__yuque_theme_${key}`;
    window.localStorage.setItem(currentKey, value);
  };
  var storeConfig = (key, defaultValue) => {
    const currentKey = `__yuque_theme_${key}`;
    return window.localStorage.getItem(currentKey) ?? defaultValue;
  };

  // src/utils/onUpConfig.ts
  var onUpConfig = async (name, value) => {
    const tabs = await chrome.tabs.query({
      url: ["https://*.yuque.com/*", "https://*.yuque.com/*"]
    }) ?? [];
    const tabIds = tabs.map((tab) => tab.id);
    upStoreConfig(name, value);
    const postData = {
      action: "config_change",
      data: [name, value]
    };
    try {
      tabIds.forEach(
        (tabId) => chrome.tabs.sendMessage(tabId, postData)
      );
    } catch {
    }
  };

  // src/popup/background.webp
  var background_default = "data:image/webp;base64,";

  // src/popup/index.ts
  var resetEm = () => {
    const em = 100;
    const targetWidth = 500;
    const innerWidth = window.innerWidth;
    const prop = innerWidth / targetWidth;
    const currentEm = Math.min(300, Math.max(em, em * prop));
    console.log(prop);
    document.documentElement.style.fontSize = currentEm + "px";
  };
  window.addEventListener("resize", void resetEm() || resetEm);
  document.querySelector("body").style.backgroundImage = `url(${background_default})`;
  var createColorItem = (item) => {
    const label = document.createElement("label");
    const [name, value] = [item[0], storeConfig(item[0], item[1])];
    label.className = "color";
    label.innerHTML = `
        <span style="background-color: ${value}"></span>
        <input name="${name}" value="${value}" data-value="${item[1]}" type="color" placeholder="${value}" />
    `;
    const span = label.querySelector("span");
    const input = label.querySelector("input");
    input.addEventListener("change", () => {
      span.style.backgroundColor = input.value;
      onUpConfig(name, input.value);
    });
    return label;
  };
  var createColorList = (title, list) => {
    const section = document.createElement("section");
    section.className = "item flex flex-center colors";
    section.innerHTML = `
        <strong class="title">${title}</strong>
        <section class="list flex grow">
        </section>
    `;
    const listElement = section.querySelector(".list");
    list.map((item) => listElement.appendChild(createColorItem(item)));
    return section;
  };
  var settingElement = document.querySelector(".settings");
  settingElement.appendChild(createColorList("B A S E", base));
  settingElement.appendChild(createColorList("OTHER", other));
  var resetColorBtn = document.querySelector("#reset-color");
  resetColorBtn.addEventListener("click", () => {
    const inputs = [
      ...document.querySelectorAll(".color input")
    ];
    inputs.forEach((input) => {
      input.value = input.dataset["value"];
      input.dispatchEvent(new Event("change"));
    });
  });
})();
